settings.global = $fps 30 $autostart 1

canvas.GothamWest = $class net.electroland.utils.lighting.canvas.ProcessingCanvas $width 700 $height 504 $fps 30 $applet net.electroland.gotham.processing.metaballs.Metaballs $name west
canvas.GothamEast = $class net.electroland.utils.lighting.canvas.ProcessingCanvas $width 700 $height 504 $fps 30 $applet net.electroland.gotham.processing.metaballs.Metaballs $name east


# RECIPIENTS
# changed this to be 1-based for using ProPlex IQ ArtNet device
recipient.WEST1 = $class net.electroland.utils.lighting.protocols.artnet.ARTNetRecipient $channels 512 $channelBits 8 $address 192.168.247.6 $universe 1
recipient.WEST2 = $class net.electroland.utils.lighting.protocols.artnet.ARTNetRecipient $channels 512 $channelBits 8 $address 192.168.247.6 $universe 2
recipient.EAST1 = $class net.electroland.utils.lighting.protocols.artnet.ARTNetRecipient $channels 512 $channelBits 8 $address 192.168.247.6 $universe 3
recipient.EAST2 = $class net.electroland.utils.lighting.protocols.artnet.ARTNetRecipient $channels 512 $channelBits 8 $address 192.168.247.6 $universe 4

# PROTOTYPE DEFINITION
fixtureType.TraxonStrip = $channels 3

detector.c0 = $fixtureType TraxonStrip $index 0 $x 0 $y 0 $w 2 $h 2 $model net.electroland.utils.lighting.detection.RedDetectionModel $tags 1
detector.c1 = $fixtureType TraxonStrip $index 1 $x 0 $y 0 $w 2 $h 2 $model net.electroland.utils.lighting.detection.GreenDetectionModel $tags 2
detector.c2 = $fixtureType TraxonStrip $index 2 $x 0 $y 0 $w 2 $h 2 $model net.electroland.utils.lighting.detection.BlueDetectionModel $tags 3


